import React, { useEffect, useState } from "react";
import "./Card.css";
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import {
  addtocart,
  UpdatePersonCart,
  checkSignedIn,
  checksigninStatus,
  recordcardnumber,
} from "../actions/index";

function Card({
  item,
  setDetailpage,
  setProductDetail,
  setEdit,
  setEditName,
  set,
  setTest,
}) {
  const dispatch = useDispatch();
  let ShowNum = 0;
  let ifopen = false;
  const cartinfo = useSelector((state) => state.addCartReducer);
  const isSignedstatus = useSelector((state) => state.checkSignedIn);
  const Cartpersonal1 = useSelector((state) => state.UpdateCartinfo);
  const Tokencuurent = useSelector((state) => state.showCartProduct);
  const Cardnumberfromredux = useSelector((state) => state.CardnumberReducer);
  const [ifadd, setIfadd] = useState(false);
  const product = isSignedstatus.product;
  const isadmin = Tokencuurent.isAdmin;
  console.log(Cardnumberfromredux);

  let totalNum = 0;
  const [number, setNumber] = useState(0);
  // let totalPrice = 0;
  const addnumbertoredux = () => {
    recordcardnumber(dispatch)({
      item: item.name,
      number: number + 1,
    });
  };
  const list = Tokencuurent.Cart;
  if (list) {
    list.forEach((e) => {
      if (e.name == item.name) {
        totalNum = e.number;
      }
    });
  }

  const user = isSignedstatus.user;
  const users = Tokencuurent.email;
  cartinfo.forEach((e) => {
    if (e.name === item.name) {
      ShowNum = e.number;
      ifopen = e.openAdd;
    }
  });

  useEffect(() => {
    // console.log("change number!");
    // console.log(number);
    addtocart(dispatch)({
      name: item.name,
      number: number,
      price: item.price,
      openAdd: true,
      ifadd: ifadd,
    });
  }, [number]);

  const cart = {
    name: item.name,
    number: totalNum,
    price: item.price,
    openAdd: true,
  };

  const add = () => {
    // setNumber(number + 2);
    // addnumbertoredux();
    setTest((e) => {
      e + 1;
    });
    setNumber(number + 1);
    setIfadd(true);

    UpdatePersonCart(dispatch)({
      user: users,
      cart: {
        name: item.name,
        number: totalNum + number + 1,
        price: item.price,
        openAdd: true,
        source: item.source,
      },
    });
  };
  // useEffect(() => {
  //   addtocart(dispatch)({
  //     name: item.name,
  //     number: number,
  //     price: item.price,
  //     openAdd: true,
  //     ifadd: true,
  //   });
  // }, [dispatch]);

  const minus = () => {
    setNumber(number - 1);
    // addtocart(dispatch)({
    //   name: item.name,
    //   number: totalNum - 1,
    //   price: item.price,
    // });
    UpdatePersonCart(dispatch)({
      user: user,
      cart: {
        name: item.name,
        number: totalNum - 1,
        price: item.price,
        openAdd: true,
      },
    });
  };

  const addbutton = () => {
    //addtocart(dispatch)(cart);
    setNumber(number + 1);
    UpdatePersonCart(dispatch)({
      user: user,
      cart: {
        name: item.name,
        number: number,
        price: item.price,
        openAdd: true,
      },
    });
  };

  return (
    <>
      <div className="box">
        <img
          src={item.source}
          alt="logo"
          className="image"
          onClick={() => {
            setDetailpage(true);
            setProductDetail({
              category: item.category,
              name: item.name,
              source: item.source,
              price: item.price,
              quantity: item.quantity,
              description: item.description,
            });
          }}
        />
        <div className="name">
          <span>{item.name}</span>
        </div>
        <div className="price">
          <span>${item.price}</span>
        </div>
        <div className="buttom-part">
          {ifopen || true ? (
            <>
              <div className="adding-extend">
                <button className="minus" onClick={() => minus()}>
                  -
                </button>
                <div className="number">
                  <span>{number}</span>
                </div>

                <button className="add" onClick={() => add()}>
                  +
                </button>
              </div>
            </>
          ) : (
            <button className="edit-button1" onClick={() => addbutton()}>
              Add
            </button>
          )}
          {isadmin ? (
            <button
              className="edit-button2"
              onClick={() => {
                setEdit(true);
                setEditName(item.name);
                set.setEitdescription(item.description);
                set.setEditCategory(item.category);
                set.setEditPrice(item.price);
                set.setEditQuantity(item.quantity);
                set.setEditLink(item.source);
                set.setId(item.id);
                setProductDetail({
                  category: item.category,
                  name: item.name,
                  source: item.source,
                  price: item.price,
                  quantity: item.quantity,
                  description: item.description,
                });
              }}
            >
              Edit
            </button>
          ) : (
            <></>
          )}
        </div>
      </div>
    </>
  );
}

export default Card;
